import React, { useState } from 'react';
import { styled } from 'styled-components';
import { NavLink } from 'react-router-dom'; // Import NavLink from react-router-dom

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleNavbar = () => {
    setIsOpen(!isOpen);
  };

  return (
    <Nav className={`navbar ${isOpen ? 'open' : ''}`}>
      <div className="companyName-container">
        <h3 className='companyName'>Twokay Chemicals</h3>
      </div>
      <div className="mobile-menu" onClick={toggleNavbar}>
        <div className={`bar ${isOpen ? 'open' : ''}`}></div>
        <div className={`bar ${isOpen ? 'open' : ''}`}></div>
        <div className={`bar ${isOpen ? 'open' : ''}`}></div>
      </div>
      <ul className={`nav-items ${isOpen ? 'open' : ''}`}>
        <li>
          <NavLink className="Link" exact to="/" activeClassName="active">
            <span>HOME</span>
          </NavLink>
        </li>
        <li>
          <NavLink className="Link" to="/products" activeClassName="active">
            <span>PRODUCTS</span>
          </NavLink>
        </li>
        <li>
          <NavLink className="Link" to="/contact" activeClassName="active">
            <span>CONTACT US</span>
          </NavLink>
        </li>
        <li>
          <NavLink className="Link" to="/about" activeClassName="active">
            <span>ABOUT</span>
          </NavLink>
        </li>
      </ul>
      <div className="search-container">
        <input type="text" placeholder="Search" className="search-input" />
        <button className="search-button">Search</button>
      </div>
      
    </Nav>
  );
};


